window.bookSummaryJSON = "<p>“Together, Ayna… Together, we’re eternal.”</p> <p></p> <p>Trading one prison for another, one kingdom for the next—there’s no escape for Ayna. Myron is free, but freedom comes at steep cost.</p> <p></p> <p>Back in Erina’s gilded prison, Ayna has one goal: escape. But with the King of Tavras holding her captive and her sister’s sacrifice keeping her from running, she’s forced to play a dangerous game. If she fails to outmaneuver Erina, she'll never break free. But waiting for Myron to return might risk everything they’ve fought for.</p> <p></p> <p>As long as Myron remains free, there’s still hope.</p> <p></p> <p>While Ayna fights to stay strong, Myron is racing to save what’s left of his court. With the help of a fairy princess and an Askarean general, he prepares for the looming threat of Tavras, armed with magic-suppressing weapons. But Tavras isn’t the only enemy. The Flames still seek revenge, and without a powerful ally, Myron’s court is doomed. An ancient enemy might just be the ally he needs.</p> <p></p> <p>Packed with sizzling romance, intrigue, and high-stake battles, Claws of Death is the heart-pounding third book in the epic romantic fantasy series, Wings of Ink, perfect for fans of A Court of Thorns and Roses, Quicksilver, and From Blood and Ash.</p> <p></p> <p>The Wings of Ink series is part of the Alcunaire!</p>"; 
